#!/bin/sh

######################################################################
# Verify that the cgw binary being tested produces the same *.cgw 
# file that an earlier known good version of cgw produced. 
# Verification is made by comparing the md5 of the generated *.cgw 
# file with the known good md5.
#
# Consensus Invocation
# --------------------
# cgw -j 1 -k 5 -r 4 -s 2 -w 0 -T -P -f baseline.frgStore \
#   -g baseline.gkpStore -o baseline baseline.cgi
######################################################################

###
# Name by which this script was invoked.
###
progname=`echo "$0" | sed -e 's/[^\/]*\///g'`

usage="Usage: $progname <cgw binary>

<cgw>            Path to cgw binary to test
"

###
# Tests should always be run from the directory
# in which the script exists
###
CWD=$(pwd)

PROGFILE=$(basename $progname)
PROGPRFX=${PROGFILE%%.sh}

RUN_DIR=${PROGPRFX}_run
TMP_DIR=${PROGPRFX}_tmp

FRAG_PREF=baseline
FRAG_STORE_DIR=${FRAG_PREF}.frgStore
GKPR_STORE_DIR=${FRAG_PREF}.gkpStore
FRAG_CGI=${FRAG_PREF}.cgi

TEST_MD5=${CWD}/${TMP_DIR}/test_md5sum.$$
GOOD_MD5=${CWD}/${TMP_DIR}/good_md5sum.$$

MD5_BIN=md5sum
CNS_BIN=""

PASSED() {
  echo "-----------------------------"; 
  echo "*** SUCCESS - Passed Test ***"; 
  echo "-----------------------------"; echo ""
  exit 0
}

FAILED() {
  echo "-----------------------------"; 
  echo "*** FAILURE - Failed Test ***"; 
  echo "-----------------------------"; echo ""
  exit 1
}

CLEANUP() {
  pushd ${RUN_DIR} > /dev/null 2>&1
  rm -rf $FRAG_STORE_DIR
  rm -rf $GKPR_STORE_DIR
  rm -rf ${FRAG_PREF}.SeqStore
  rm -rf stat/
  rm -f  ${FRAG_PREF}.*
  rm -f  $TEST_MD5
  rm -f  $GOOD_MD5
  echo
  popd > /dev/null 2>&1

  rmdir $RUN_DIR
  rmdir $TMP_DIR
}

CHECK_UTILS() {
  $(which $MD5_BIN > /dev/null 2>&1) || {
    echo "Err: $MD5_BIN binary not found"
    exit 1
  }
}

INIT() {
  rm -rf $RUN_DIR
  mkdir $RUN_DIR

  rm -rf $TMP_DIR
  mkdir $TMP_DIR

  create_cgi_file
  create_frgStore_files
  create_gkpStore_files
}

#####
# Function
#   gen_good_md5
#
# Purpose
#   Create the file containing our baseline MD5 
#   checksums of the cgw *.cgw file generated 
#   from a baseline run of consensus
# 
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - NONE
#####
gen_good_md5() {
  cat > $GOOD_MD5 << EOF
cb7af3acaf9200806f229d6861fb1fd1  baseline.cgw
EOF
}

#####
# Function
#   gen_test_md5
#
# Purpose
#   Generate MD5 sums of cgw created *.cgw
#   file by running 'md5sum' against the file 
# 
# Arguments
#   file - *.cns file  
#         
# Return
#   success - NONE
#   failure - exit 1
#####
gen_test_md5()
{
  local file=$1

  if [ ! -f $file ]; then
    echo "gen_test_md5: directory $dir does not exist";
    exit 1;
  fi

  md5sum $file > $TEST_MD5
}

cmp_md5s() 
{
  local gmd5_line=""
  local gmd5_file=""
  local tmd5_line=""
  local gmd5=""
  local tmd5=""
  local c=1
  local n=$(wc -l <$GOOD_MD5)

  while [ $c -lt $n ]
  do
    gmd5_line=$(head -n $c $GOOD_MD5 | tail -1)
    gmd5=$(echo $gmd5_line | awk '{ print $1 }')

    gmd5_file=$(echo $gmd5_line | awk '{ print $NF }')
    tmd5_line=$(grep $gmd5_file $TEST_MD5)
    ret=$?

    if [ "$ret" != "0" ]; then
      echo "Error: $gmd5_file not found in file $TEST_MD5"
      FAILED        
    fi

    tmd5=$(echo $tmd5_line | awk '{ print $1 }')
    if [ "$tmd5" != "$gmd5" ]
    then
      echo -n "Error: test md5sum and baseline md5sum do "
      echo    "not match for file $gmd5_file"
      echo "baseline md5: $bmd5"
      echo "baseline md5: $tmd5"
      FAILED 
    fi 

    c=$(( $c + 1 ))
  done
}

#####
# Function
#   clean_cgw_file
#
# Purpose
#   Remove things like the $Id: tag which show up in the
#   generated *.cgw file and which may throw off the md5
#   sum
#
# Arguments
#   file - *.cgw file to clean up
#
# Return
#   success - NONE
#   failure - exit 1
#####
clean_cgw_file() 
{
  local file=$1
  local tmpf=/tmp/.cgw.$$

  cat $file | awk '
    BEGIN {
      stack = 0;
      state = "NONE";
    }

    {
      if (state == "NONE") {
        if (/^{ADL/) {
          state = "INADL";
          stack++;
        }
      }

      if (state == "INADL") {
        if (/^who:/) {
          print "who:";
          next;
        }
        if (/^ctm:/) {
          print "ctm:";
          next;
        }
        if (/^com:/) {
          print "com:";
          state = "INADL_COM";
        }
      }
 
      if (state == "INADL_COM") 
        if (/^\./)
          state = "INADL";

      if (state != "INADL_COM")
        print $0

      if (state == "INADL") {
        if (/^}/) {
          state = "NONE";
          stack--;

          if (stack != 0) {
            print NR"\t"$0;
            exit 1;
          }
        }
      }
    }
  ' > $tmpf

  mv $tmpf $file
}

#####
# Function
#   RUN_TEST
#
# Purpose
#   Run the given cgw binary against the fragStore/,
#   gkpStore/, and *.cgi file within  this script. 
#   Verify that the results match the baseline results 
#   by comparing MD5 checksums of the generated 
#   baseline.cgw file
#
# Arguments
#   NONE
#
# Return
#   success - NONE
#   failure - exit 1
#####
RUN_TEST() {
  if [ ! -f $CGW_BIN ]; then
    echo "Err: $(pwd)/cgw executable not found"
    FAILED
  fi

  if [ ! -d ${RUN_DIR}/$FRAG_STORE_DIR ]; then
    echo "Err: $(pwd)/${RUN_TEST}/$FRAG_STORE_DIR directory not found"
    FAILED
  fi

  if [ ! -d ${RUN_DIR}/$GKPR_STORE_DIR ]; then
    echo "Err: $(pwd)/${RUN_TEST}/$GKPR_STORE_DIR directory not found"
    FAILED
  fi

  if [ ! -f ${RUN_DIR}/$FRAG_CGI ]; then
    echo "Err: $(pwd)/${RUN_TEST}/$FRAG_CGI file not found"
    FAILED
  fi

  pushd ${RUN_DIR} > /dev/null 2>&1

  ###
  # Clean up from any previous runs
  ###
  rm -f ${FRAG_PREF}.cgw

  ###
  # Run cgw against the frag file contained
  # within this script
  ###
  $CGW_BIN -j 1 -k 5 -r 4 -s 2 -w 0 -T -P -f $FRAG_STORE_DIR \
    -g $GKPR_STORE_DIR -o $FRAG_PREF $FRAG_CGI > /dev/null 2>&1
  ret=$?

  if [ "$ret" -ne "0" ]; then
    echo "Err: $(pwd)/cgw failed!"
    FAILED
  fi

  if [ ! -f ${FRAG_PREF}.cgw ]; then
    echo "Err: consensus *.cgw file NOT created"
    FAILED
  fi

  clean_cgw_file ${FRAG_PREF}.cgw

  ###
  # Generate the MD5 of the *.cgw file we 
  # just created
  #
  # Then create the MD5s of the known good (baseline)
  # *.cgw file
  ###
  gen_test_md5 ${FRAG_PREF}.cgw
  gen_good_md5

  ###
  # They should be the same since we are running
  # consensus against the same input used to 
  # generate the baseline MD5s
  #
  # Test will abort within this function if the MD5 sums
  # do not match
  ###
  cmp_md5s

  popd > /dev/null 2>&1
}

